// Placeholder for background image - replace with your actual base64 image
// Set to null to disable background image until you provide the real template
const TRANSCRIPT_TEMPLATE_BASE64: string | null = 'data:image/jpeg;base64,'

function getGradePoint(grade: string): number {
  const gradeMap: { [key: string]: number } = {
    'A+': 10, 'A': 9, 'A-': 8,
    'B+': 8, 'B': 7, 'B-': 6,
    'C+': 6, 'C': 5, 'C-': 4,
    'D+': 4, 'D': 3, 'D-': 2,
    'F': 0
  }
  return gradeMap[grade] || 0
}

function calculateGPA(subjects: any[]): number {
  let totalPoints = 0
  let totalCredits = 0
  
  subjects.forEach(subject => {
    const gradePoint = getGradePoint(subject.grade)
    totalPoints += gradePoint * subject.credits
    totalCredits += subject.credits
  })
  
  return totalCredits > 0 ? totalPoints / totalCredits : 0
}

function getOverallGrade(gpa: number): string {
  if (gpa >= 9) return 'A+'
  if (gpa >= 8.5) return 'A'
  if (gpa >= 7.5) return 'A-'
  if (gpa >= 7) return 'B+'
  if (gpa >= 6.5) return 'B'
  if (gpa >= 6) return 'B-'
  if (gpa >= 5.5) return 'C+'
  if (gpa >= 5) return 'C'
  if (gpa >= 4.5) return 'C-'
  if (gpa >= 4) return 'D+'
  if (gpa >= 3) return 'D'
  return 'F'
}

function addBackgroundImage(doc: any, imageBase64: string | null) {
  if (!imageBase64) {
    // Create a professional template outline when no background image is provided
    doc.setDrawColor(128, 0, 128) // Purple border
    doc.setLineWidth(2)
    doc.rect(10, 10, 190, 277) // Page border
    
    // Add decorative header border
    doc.setLineWidth(1)
    doc.rect(15, 15, 180, 30) // Header area
    return
  }

  try {
    // Validate that this is a proper base64 image
    if (imageBase64.startsWith('data:image/')) {
      doc.addImage(imageBase64, 'JPEG', 0, 0, 210, 297) // A4 size in mm
    } else {
      throw new Error('Invalid image format')
    }
  } catch (error) {
    console.error('Error adding background image:', error)
    // Fallback: create a simple border if image fails
    doc.setDrawColor(128, 0, 128)
    doc.setLineWidth(2)
    doc.rect(10, 10, 190, 277)
    
    // Add error message
    doc.setFontSize(8)
    doc.setTextColor(255, 0, 0)
    doc.text('Background image failed to load', 15, 290)
  }
}

